import React from 'react'
import {Link} from 'react-router-dom'
const Nav=()=>{
    return(
        <section className='navbar'>
            <div>
                <a>HariCharan</a>
            </div>
            <div>
<Link to='/'>Home</Link>
<Link to='/About'className='navbar2'>About</Link>
<Link to='/Servive'>Servive</Link>
            </div>
        </section>
    );
}
export default Nav;
